/* eslint-disable array-callback-return */
import './App.css';
import perfil from "./images/perfil.svg"
import sacola  from "./images/sacola.svg"
import Logo from "./components/logo/index"
import OptionsHeader from './components/OptionsHeader';


const textOption = ['Category', 'Favorites', 'My bookshelf'];
const iconOption = [perfil, sacola]


function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <Logo />

        <OptionsHeader />

        <ul className='Icons'>
          {iconOption.map(icon => <li className='Icon-list'><img src={icon} alt=''></img></li>)}
        </ul>
      </header>
    </div>
  );
}

export default App;
